import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent {
  title = 'Menu';
}
<app-menu></app-menu>

<div class="my-5 py-5 bg-red-50">
  <div class="text-center py-56  font-sans ">
    <h1 class="font-bold text-8xl">
      It is never too late <br>
      To Fall in love.
    </h1>

    <h6>
      One day, someone will walk into your life and make you see why it<br>

      never worked out with anyone else.
    </h6>
  </div>

</div>
